class Solution:
	def findMaxLength(self, nums):
		if nums == []:
			return 0
		count,OneZeroLen,maxLen = 0,0,0
		countdict = {0:-1}
		for i,num in enumerate(nums):
			if num == 0:
				count -= 1
			else:
				count += 1
			if not count in countdict:
				countdict[count] = i
			else:
				OneZeroLen = i-countdict[count]
				if OneZeroLen > maxLen:
					maxLen = OneZeroLen
		return maxLen



